import React from 'react';
import {
  PDFDownloadLink,
  Page,
  Text,
  View,
  Document
} from '@react-pdf/renderer';

const MyDoc = (
  <Document>
    <Page>
      <View>
        <Text>Section #1</Text>
      </View>
      <View>
        <Text>Section #2</Text>
      </View>
    </Page>
  </Document>
);

const PDF = () => (
  <PDFDownloadLink document={MyDoc} fileName="somename.pdf">
    {({ blob, url, loading, error }) =>
      loading ? 'Loading document...' : 'Download now!'
    }
  </PDFDownloadLink>
);


export default PDF;
